import React from "react";
import "./CallButton.css"; // Đảm bảo rằng bạn có file CSS cho nút này

const CallButton = () => {
  const phoneNumber1 = "0909260991"; // Số điện thoại 1
  const phoneNumber2 = "0912345678"; // Số điện thoại 2

  return (
    <div className="call-buttons-container">
      {/* Nút gọi 1 */}
      <a href={`tel:${phoneNumber1}`} className="call-button-email">
      <div className="call-button-background"></div> {/* Nền có hiệu ứng */}
        <img className="img_icon" src="/images/icon.png" alt="Call" /> 
      </a>

      {/* Nút gọi 2 */}
      <a href={`tel:${phoneNumber2}`} className="call-button-call">
      <div className="call-button-background-call"></div> {/* Nền có hiệu ứng */}
        <img className="img_icon" src="/images/icon_phone.png" alt="Call" /> {/* Đường dẫn tới biểu tượng */}
      </a>
    </div>
  );
};

export default CallButton;
